        var fallaZonaReparacion =  [[${fallaZonaReparacion}]];/* Aqu obtn el valor de la variable del modelo */ 
        var fallaLinea1 =  [[${fallaLinea1}]];/* Aqu obtn el valor de la variable del modelo */
        
        
        if(fallaTorre)parpadearRojo("torre de agua fria");
        if(fallaZonaReparacion)parpadearRojo("zona de reparacion");
        if(fallaLinea1)parpadearRojo("linea 1");
        
        
        function parpadearRojo( id)
        {
            var elemento = document.getElementById(id);
            var count = 0;
            var interval = setInterval(function() {
                if (count % 2 == 0) {
                    elemento.style.fill = 'red';
                } else {
                    elemento.style.fill = 'transparent'; // O el color de texto original
                }
                count++;
                
            }, 500); // Cambia 500 a la velocidad de parpadeo deseada en milisegundos

            
        }
       
            
          
        
    
    </script>
       
       
       
        <footer th:replace="plantillas/plantilla::footer"></footer>
    </body>
